function Pizza(props){
    const mainHeading = props.mainHeading;
    const secondHeading = props.secondHeading;
    const text = props.text;
    return(
        <div>
            <h1>{mainHeading}</h1>
            <h2>{secondHeading}</h2>
            <p>{text}</p>
            <img src="pizzas/margherita.jpg" alt="Pizza" />
        </div>
    )
}

export default Pizza;
